import styled from "styled-components";

export const GlobalContainer = styled.div`
  margin: 0 auto;
  position: relative;
  zoom: 1;
  background: #fff;
  line-height: 1.34;
  margin: 0;
  padding: 0;
`;

export const Fuck = styled.div`
  width: 100%;
  background: #fff;
  height: 619px;
`;

export default GlobalContainer;
// 만약에 1개만 export한다면 export default 행 맨 끝으로 보내서 구분시켜야 함(문법에러)
